import { Box, Tab, Tabs } from 'grommet';
import React from 'react';

function TabsForm() {
    return(
        <Box>
            <Tabs>
                <Tab></Tab>
                <Tab></Tab>
                <Tab></Tab>
            </Tabs>
        </Box>
    );
}

export default TabsForm;
